import { BorderlessTableOutlined } from "@ant-design/icons";

const initialState = {
  name: 'sangbin',
  age: 27,
  password: BorderlessTableOutlined,
}

const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return console.log("type check !");
  }
};

export default rootReducer;
